import React from "react";
  
const Contact = () => {
  return (
    <div className="container">
        <section className="title">
          <h1>Tiago Almeida</h1>
          <h2>Copywriter</h2>
          
          <div className="contact">
            <div className="contact-1"></div>
          </div>
        </section>
    </div>
  );
};
  
export default Contact;
